
from typing import List, Tuple

import numpy as np

def solve(K: np.ndarray) -> List[Tuple[float, float, float]]:
    """Solves the core system of polynomial equations, i.e.,

    k11*x^2 + (k12*y + k13)*x + k14*y^2 + k15*y + k16 = 0
    k21*x^2 + (k22*z + k23)*x + k24*z^2 + k25*z + k26 = 0
    k31*y^2 + (k32*z + k33)*y + k34*z^2 + k35*z + k36 = 0

    for depth parameters (x, y, z). See Eq. (4a) - (4c) in the paper.
    
    The function returns only the real-valued solutions with positive depths 
    corresponding to points in front of the cameras.
    
    Args:
        K (np.ndarray): a 3 x 6 matrix representing the above system

    Returns:
        List[Tuple[float, float, float]]: a list of depth triplets, up to 32 solutions 
    """
    assert K.shape == (3, 6)

    k11, k12, k13, k14, k15, k16 = K[0, :]
    k21, k22, k23, k24, k25, k26 = K[1, :]
    k31, k32, k33, k34, k35, k36 = K[2, :]

    poly = _do_sylvester_elimination(K)
    
    solutions = []
    
    for z in np.roots(poly):

        # Skip imaginary solutions and negative depths
        if np.imag(z) != 0.0 or np.real(z) < 0:
            continue

        for y in np.roots([k31, k32*z + k33, k34*z**2 + k35*z + k36]):

            if np.imag(y) != 0.0 or np.real(y) < 0:
                continue

            for x in np.roots([k11, k12*y + k13, k14*y**2 + k15*y + k16]):

                if np.imag(x) != 0.0 or np.real(x) < 0:
                    continue

                # Consisteny check of Eq. (4c) versus (4b), tolerance is arbitrary
                tol = 1e-5
                if abs(k21 * x**2 + (k22*z + k23)*x + (k24*z**2 + k25*z + k26)) > tol:
                    continue

                solutions.append((np.real(x), np.real(y), np.real(z)))

    return solutions

def _do_sylvester_elimination(K: np.ndarray) -> List[float]:
    """Returns coefficients of a degree 8 polynomial resulting from applying Sylvester 
    elimination twice to Eq. (4a) - (4c), i.e., the symbols A, B, ..., I in Eq. (5). 
    """
    assert K.shape == (3, 6)

    k11, k12, k13, k14, k15, k16 = K[0, :]
    k21, k22, k23, k24, k25, k26 = K[1, :]
    k31, k32, k33, k34, k35, k36 = K[2, :]

    # Coefficients were calculated symbolically with Macaulay2, via its web interface 
    # https://www.unimelb-macaulay2.cloud.edu.au/#home.
    # Expressions are not simplified, there is room for optimization.
    # The following comamnds were used:
    # > R = ZZ[k11,k12,k13,k14,k15,k16,k21,k22,k23,k24,k25,k26,k31,k32,k33,k34,k35,k36][x,y,z]
    # > f = k11*x^2 + (k12*y + k13)*x + k14*y^2 + k15*y + k16
    # > g = k21*x^2 + (k22*z + k23)*x + k24*z^2 + k25*z + k26
    # > h = k31*y^2 + (k32*z + k33)*y + k34*z^2 + k35*z + k36
